function auto_set_icons() {

    document.querySelectorAll('.set-icon').forEach((set_icon => {

        let requested_set_icon = set_icon.innerHTML;
        let count = 0;

        while (true) {

            if (set_icon_library[count].name == requested_set_icon) {
                break;
            }

            count++;

        }

        if (set_icon.classList.contains('filled') && set_icon_library[count].filled_svg != null) {
            set_icon.innerHTML = set_icon_library[count].filled_svg;
        } else {
            set_icon.innerHTML = set_icon_library[count].svg;
        }

    }))

    document.querySelectorAll('.set-icon').forEach(icon => {
        icon.classList.remove('set-icon', 'filled');
    })

}

auto_set_icons();